import Footer from "./Footor";
import "./style.css"
import Cards from "./Blog_card"
import Card_soon from "./Card_soon";

function Blog() {
  const courses = [
    "SMC Concepts",
    "Market Structure & Price Readings",
    "Candlestick Patterns",
    "Technical Analysis",
    "Fundamental Analysis"
  ];

  return (
    <div>
      <div className="w-full h-screen gap-5  bg-themeblack pt-32 px-16 relative flex flex-col z-30 ">
        <div className="w-2/5 h-auto  bg-themegreen glow-hover glass-green2_button overflow-hidden text-white" >
          <h1 className=" font-serif text-6xl">Price action</h1>

            <ul className=" pl-6 space-y-3 lg:w-3/3 font-sans lg:font-medium md:font-light text-textwhite text-lg md:text-xl pt-2">
            {courses.map((course) => (
              <li  className=" text-textwhite">
                {course}
              </li>
            ))}
          </ul>

        </div>
      </div>
      <Footer />
    </div>
  );
}

export default Blog;
